import React from 'react'

export const StoryList = ({ stories }) => {
    return (
        <div className='stories'>
            {
                stories.map(story => (
                    <h2 key={story.id}>{story.title}</h2>
                ))
            }
        </div>
    )
}

export default StoryList;
